String.prototype.endsWith=function(t){return this.substr(this.length-t.length)===t},String.prototype.startsWith=function(t){return this.substr(0,t.length)===t},String.prototype.trim=function(t){t||(t="\\s");var r=new RegExp("^"+t+"+|"+t+"+$","g");return this.replace(r,"")},String.prototype.trimEnd=function(t){t||(t="\\s");var r=new RegExp(t+"+$","g");return this.replace(r,"")},String.prototype.trimStart=function(t){t||(t="\\s");var r=new RegExp("^"+t+"+","g");return this.replace(r,"")},String.prototype.toCharArray=function(){for(var t=[],r=0;r<this.length;r++)t.push(this.charAt(r));return t};